import React from "react";
import App from "./App";

const Home = () => {
    return (
        <div>
            <header class="bg-gray fixed w-100 ph3 pv3 pv4-ns ph4-m ph5-l">
                <nav class="f6 fw6 ttu tracked">
                    <a class="link dim black dib mr3" href="#" title="Home">Home</a>
                    <a class="link dim black dib mr3" href="http://localhost:3000" title="About">About</a>
                    <a class="link dim black dib mr3" href="#" title="Store">Store</a>
                    <a class="link dim black dib" href="#" title="Contact">Contact</a>
                </nav>
            </header>
        </div>
    );
}

export default Home;
